#Bendita | ¡Boca es semifinalista de la Copa Libertadores y parece que “Horacio Paganini” aprovechó la ocasión para hacer enojar a nuestro experto en deportes! 😂

¿Pagani es de Boca? ¡Los leemos!

@soypagani @leoraff_vintage @okleogonzalez

#Bendita | Silvina Luna dijo en el programa de German Paoloski que Leo DiCaprio le pidió un "pucho" y ella flashó tiroteo. En el piso de Bendita analizaron la situación y Maglietti reveló que a ella también un galán le había pedido un cigarrillo, pero que no lo tomó como un intento de acercamiento 😏

Por supuesto, sus compañeros no se la dejaron pasar y la abogada confesó que había sido Vicuña. "Igual ni sabía quién soy",confeso la rubia. ¿El exde Pampita le tiró onda a nuestra panelista? 🤔

@alemaglietti 🔥

#MoriaesMoria | Impensado. Tras la revelación de Dalia Gutmann a Moria Casán, asegurando que fue la responsable de sacarla de la depresión, la One no tuve mejor idea que rememorar el guion final de "Rita Turdero, la pantera de Mataderos" y le cumplió el sueño a la humorista.  

"¡Chiribí, chiribí, uh, uh!", fue la parte que más emocionó decir a Gutmann. ¡La rompieron!

@daliagutmann @moria_laone
